import AllInfo from "../components/AllInfo";
import {useEffect, useState} from 'react'
import axios from 'axios'

const Main = () => {
    const [creatures, setCreatures] = useState();
    const [loaded, setLoaded] = useState(false);

    useEffect(()=>{
        axios.get('https://botw-compendium.herokuapp.com/api/v2/all')
            .then(res => {
                setCreatures(res.data.data.creatures)
                setLoaded(true);
                console.log(res.data.data.creatures)
            })
            .catch(err=>console.error(err))
    })

    return(
        <div>
            {creatures.map((item, i) => 
                <div key={i}>
                    <p>{item.food}</p>
                </div>
            )}
        </div>
    )
}

export default Main;
